import React, { useEffect, useState } from "react";

const ListingDashboard = () => {
  const [listings, setListings] = useState([]);

  useEffect(() => {
    fetch("/api/displaylistings")
      .then((res) => res.json())

      .then((data) => setListings(data))

      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="flex h-screen w-full justify-center items-start">
      <div className="overflow-auto">
        <table className="min-w-full border-collapse border border-gray-300 bg-white rounded-md shadow">
          <thead className="bg-blue-100 text-gray-700">
            <tr className="">
              <th className="px-10 py-2 text-left border-b">Property Title</th>
              <th className="px-10 py-2 text-left border-b">Description</th>
              <th className="px-10 py-2 text-left border-b">Price</th>
              <th className="px-10 py-2 text-left border-b">Images</th>
              <th className="px-10 py-2 text-left border-b">Location</th>
              <th className="px-10 py-2 text-left border-b">Agent Email</th>
            </tr>
          </thead>

          <tbody>
            {listings.map((property, idx) => (
              <tr
                key={idx}
                className={
                  idx % 2 === 0 ? "bg-white border-b" : "bg-gray-50 border-b"
                }
              >
                <td className="px-10 border-l-8 border-gray-300 py-2 border-b">
                  {property.title}
                </td>
                <td className="px-10 py-2 border-b">{property.description}</td>
                <td className="px-10 py-2 border-b">{property.price}</td>
                <td className="px-10 py-2 border-b">{property.location}</td>
                <td className="px-10 py-2 border-b">
                  {property.agent_contact}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ListingDashboard;
